import React from 'react';
import poster from '../assets/poster.jpg';

const highlights = [
  { title: 'I.D.C. Hackathon 2025', desc: 'Over 500 participants, 50+ projects.', img: poster },
  { title: 'Tech Trends Webinar', desc: 'Industry leaders shared insights.', img: poster },
];

const CommunityHighlights = () => (
  <section className="community-highlights">
    <h3>Community Highlights</h3>
    <div className="highlights-grid">
      {highlights.map(h => (
        <div className="highlight-card" key={h.title}>
          <img src={h.img} alt={h.title} className="highlight-img" />
          <h4>{h.title}</h4>
          <p>{h.desc}</p>
        </div>
      ))}
    </div>
  </section>
);

export default CommunityHighlights;
